    <style>
        body {
            background-color: #000000;
        }
        
      .loader{
        margin: 0 0 2em;
        height: 1000px;
        width: 20%;
        text-align: center;
        padding: 1em;
        margin: 0 auto 1em;
        display: inline-block;
        vertical-align: top;
      }
        .loader {
        position: fixed;
        z-index: 99;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: white;
        display: flex;
        justify-content: center;
        align-items: center;
    }
    
    .loader > img {
        width: 100px;
    }
    
    .loader.hidden {
        animation: fadeOut 1s;
        animation-fill-mode: forwards;
    }
    
    @keyframes fadeOut {
        100% {
            opacity: 0;
            visibility: hidden;
        }
    }
    
        #logo {
        width: 189.6px;
        height: 360.8px;
    }
    
        #talket {
            display: flex;
        justify-content: center;
        align-content: center;
            text-align: center;
        }
    
        #warle {
            position: relative;
            top: 20px;
            font-family: pirulen;
        font-size: larger;
        display: flex;
        justify-content: center;
        align-content: center;
        }
    
    @font-face {
        font-family: 'pirulen';
        src: url('pirulen-webfont.woff2') format('woff2'),
            url('pirulen-webfont.woff') format('woff');
        font-weight: normal;
        font-style: normal;
    
    }
